import routes from './routes';

export default [
  {
    name: 'Menu',
    path: routes.MENU,
  },
  {
    name: 'About',
    path: routes.ABOUT,
  },
  {
    name: 'Contact',
    path: routes.CONTACT,
  },
  {
    name: 'Delivery',
    path: routes.DELIVERY,
  },
];
